import React from 'react';
import style from './Terms.module.css';

function Terms() {
    return (
        <div className='displayFlexColumn' id='alignItemsCenter'>
            <div id={style.mainDiv}>
                <h1 id={style.mainTitle}>Privacy Policy</h1>
                <p>
                    Thank you for choosing to be part of our community at FindDevs 
                    ("<span className='font800'>Company</span>", "<span className='font800'>we</span>", "<span className='font800'>us</span>", "<span className='font800'>our</span>"). We are committed to protecting your 
                    personal information and your right to privacy. 
                </p>
            </div>
        </div>
    )
}

export default Terms;
